import Ruokalista from './components/Ruokalista';
import Ruokalomake from './components/Ruokalomake';
import Unilista from './components/Unilista';
import Unilomake from './components/Unilomake';


const unet = [
  {
    id: 1,
    maara: '7h 30min',
    pvm: '26.5.2022',
    laatu: 'Hyvä',
  },
  {
    id: 2,
    maara: '8h 30min',
    pvm: '27.5.2022',
    laatu: 'Heräsin todella pirteänä',
  },
]
const ruoat = [
  {
    id: 1,
    nimi: 'maksalaatikko',
    pvm: '26.5.2022',
    kellonaika: '16.00',
    lisatiedot: 'Päivällinen'
  },
  {
    id: 2,
    nimi: 'Riisipuuro',
    pvm: '27.5.2022',
    kellonaika: '8.00',
    lisatiedot: 'Aamupala'
  },
]


function App() {
  return (
    <div>
      <h2>Ruokalista</h2>
      <Ruokalista ruoat={ruoat} /> <br />

      <h2>Lisää ruoka</h2>
      <Ruokalomake /> <br />

      <h2>Unilista</h2>
      <Unilista unet={unet} /> <br />

      <h2>Lisää uni</h2>
      <Unilomake /> <br />

    </div>
  );
}

export default App;
